import { MaterialModule } from './../../../shared/material.module';
import { AuthService } from './../../../shared/services/auth/auth.service';
import { AuthRoutingModule } from './../../auth-routing.module';
import { Component, OnInit } from '@angular/core';
import { Router, RouterModule, Routes,ActivatedRoute } from '@angular/router';



@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.sass'],

})
export class LoginComponent implements OnInit {
  hide = true;
  checked = false;
  constructor(
    private router:Router,
    route:AuthRoutingModule,
    private authService: AuthService,
    materialModule:MaterialModule
    ) {
  }
  ngOnInit(): void {

    if(false)
    {
      this.router.navigate(['auth/signup']);
    }

  }
}
<div class="card shadow p-5 mb-5 bg-light" style="border-radius: 2rem;">
  <div class="card-body py-5 px-md-5">
    <form>
      <div class="form-outline mb-4">
      <mat-form-field appearance="fill">
        <mat-label>Username</mat-label>
        <input matInput placeholder="Placeholder">
        <mat-icon matSuffix><i class="fa fa-user-circle" aria-hidden="true"></i></mat-icon>
        <!-- <mat-hint>Hint</mat-hint> -->
      </mat-form-field>
    </div>
    <div class="form-outline mb-4">
      <mat-form-field appearance="fill" class="w-100">
        <mat-label>Enter your password</mat-label>
        <input matInput [type]="hide ? 'password' : 'text'">
        <button mat-icon-button matSuffix (click)="hide = !hide" [attr.aria-label]="'Hide password'" [attr.aria-pressed]="hide">
          <mat-icon>{{hide ? 'visibility_off' : 'visibility'}}</mat-icon>
        </button>
      </mat-form-field>
    </div>
    <div class="form-check d-flex justify-content-center mb-4">
    <mat-slide-toggle
          class="example-margin"
          color="primary"
          [checked]="checked"
          >
        Keep Me Login
      </mat-slide-toggle>
  </div>
  </form>

    <form>




      <div class="row d-flex justify-content-center">
        <!-- Submit button -->
        <div class="col d-flex justify-content-center">
          <button type="submit" class="btn btn-primary btn-block">
            Login
          </button>
        </div>
        <div class="col d-flex justify-content-center">
          <button routerLink="../signup" type="cancel" class="btn btn-primary btn-block">
            Register
          </button>
        </div>
      </div>
    </form>
  </div>
</div>
